prompt --application/shared_components/security/authorizations/ccms_rights
begin
wwv_flow_imp_shared.create_security_scheme(
 p_id=>wwv_flow_imp.id(29557613980225370)
,p_name=>'CCMS_Rights'
,p_scheme_type=>'NATIVE_FUNCTION_BODY'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'	l_usr_type VARCHAR2(20);',
'BEGIN',
'	SELECT UPPER(USER_TYPE_NAME) INTO l_usr_type ',
'	FROM CCMS_USER_TYPE_MST',
'	WHERE USER_TYPE_ID = (SELECT USER_TYPE_ID FROM CCMS_USER_MST WHERE UPPER(USERNAME) = UPPER(:APP_USER));',
'',
'	IF NVL(l_usr_type,''X'') = l_usr_type THEN',
'		--HTP.P(''TRUE'');',
'		RETURN TRUE;',
'	ELSE',
'		--HTP.P(''FALSE'');',
'		RETURN FALSE;',
'	END IF; ',
'END;'))
,p_version_scn=>39409883740924
,p_caching=>'BY_USER_BY_SESSION'
);
end;
